import React from 'react';

// Import components
import MyIcons from './MyIcons';

// Import icon image
import ImageUrl from '../images/avatar_batman.png';

// Import React Icon
import { FiSettings } from 'react-icons/fi';

// Dummy component
const MyPost = props => {
	return (
		<form style={styles.myPost}>
			<MyIcons IconImg={ImageUrl} ImageAlt="Icon of user" />
			<button>
				<FiSettings />
			</button>
			<h1>
				Horrified Anti-Vaxxer Discovers Every American Who Got Smallpox Vaccine
				In 19th Century Now Dead
			</h1>
			<p>
				LYNCHBURG, VA—Astounded by the damning information, local anti-vaxxer
				Pete Dixon was reportedly horrified Thursday after discovering that
				every single American who got a smallpox vaccine in the 19th century was
				now deceased. “We’re expected to…{' '}
			</p>
		</form>
	);
};

// Export
export default MyPost;

// Styling with CSS-in-JS
const styles = {
	myPost: {
		padding: '10px',
		backgroundColor: 'lightGrey',
		color: 'black',
	},
	inputContainer: {
		display: 'flex',
		marginBottom: '10px',
	},
	input: {
		padding: '10px',
		margin: '5px',
		flex: '1',
	},
	buttonContainer: {
		textAlign: 'right',
		padding: '10px',
	},
	button: {
		backgroundColor: 'blue',
		color: 'white',
		padding: '10px',
		cursor: 'pointer',
	},
};
